import React from "react";
import { Link, Outlet } from "react-router-dom";
import styled, { css } from "styled-components";

const Header = () => {
    return (
        <div>
            <HeaderContainer>
                <Link to="/">
                    <img src="/Logo/logo.svg" alt="logo"></img>
                </Link>
                <HeaderContent>
                    <li>
                        <Link to="/contacts">Контакты</Link>
                    </li>
                    <li>
                        <Link to="/calculation">Калькулятор</Link>
                    </li>
                    <li>
                        <Link to="/about">О нас</Link>
                    </li>
                </HeaderContent>
            </HeaderContainer>
            <Outlet />
        </div>
    )
}

const HeaderContainer = styled.div`
    position: fixed;
    width: 80%;
    height: 40px;
    margin: 0px auto;
    padding: 10px 0px;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    background-color: white;
`;

const HeaderContent = styled.ul`
    font-family: 'Inter';
    font-size: 16px;
    line-height: 19px;
    width: 70%;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    list-style: none;
`;



export default Header
